import React from "react";

function SearchW() {
    return  <form onSubmit={this.searchWordList}>Look for the word   
       <input value={this.state.wordInputSearch} onChange={this.wordSearch}/>
       <button type="submit">Search</button>
       </form>
}
export default SearchW;
